import React from "react";

export default class Register extends React.Component {
  state = {};
  render() {
    return (
      <div>
        Register:
        <form onSubmit={this.login}>
          Username:
          <input
            onChange={(event) => {
              this.setState({ username: event.target.value });
            }}
          />
          <br />
          <br />
          Password:
          <input
            type="password"
            onChange={(event) => {
              this.setState({ password: event.target.value });
            }}
          />
          <br />
          <br />
          Role:
          <div>

          </div>
          <br />
          <br />
          <button>Login</button>
        </form>
      </div>
    );
  }
}
